window.bookSummaryJSON = "<p><b>Get the Space Hunter War Complete Series Box Set, featuring all six books in the series. Explosive military sci fi action from a pair of bestsellers.</b></p> <p>Jack Bennet returns from the war to find the life he left behind has moved on without him. The only option he has to make ends meet lies in a military surplus junkyard starship. What’s a former Combat Search and Rescue soldier to do?</p> <p>Fix up the ship, hire the cheapest pilot—a notorious drunk—and take the first contract that comes up: collect a bounty on one of the most ruthless killers in the Pirate Worlds, a place crawling with thieves, cutthroats and con artists whose primary language is violence. Jack must abandon his nice guy persona, or exploit it, if he is to survive.</p> <p>What could possibly go wrong?</p> <p><b>Experience this special edition omnibus of an explosive Military Sci-Fi Series from bestseller Rick Partlow, author of Drop Trooper, and debut author Pacey Holden.</b></p>"; 
